db.patients.aggregate([
  {
    $match: {
      "ENCOUNTERS.CONDITIONS.DESCRIPTION": "Streptococcal sore throat (disorder)"
    }
  },
  {
    $unwind: "$ENCOUNTERS"
  },
  {
    $unwind: "$ENCOUNTERS.CONDITIONS"
  },
  {
    $project: {
      _id: 0,
      patient_name: { $concat: ["$FIRST", " ", "$LAST"] },
      encounter_date: "$ENCOUNTERS.START",
      condition: "$ENCOUNTERS.CONDITIONS.DESCRIPTION"
    }
  }
])
